window.bookSummaryJSON = "<p>Evie’s always thought of herself as a normal teenager, even though she works for the International Paranormal Containment Agency, her ex-boyfriend is a faerie, she’s falling for a shape-shifter, and she’s the only person who can see through paranormals’ glamours. But Evie’s about to realize that she may very well be at the center of a dark faerie prophecy promising destruction to all paranormal creatures.</p> <p>So much for normal.</p>"; 
